# recursive call
# enumerate all the posibilities
class Solution:
	# @param {integer[]} nums
	# @return {boolean}
	def canJump(self, nums):
		# the maximum it can jump is current max(nums[i],canJump[i-1])
		canJump = [0] * len(nums) 
		numsl = len(nums) - 1
		for i,num in enumerate(nums):
			if i == 0:
				canJump[0] = num
			else:
				canJump[i] = max(canJump[i-1],nums[i-1]) -1
			if canJump[i] < 0:
				return False
		return canJump[numsl] >= 0
